  function callProgress(){
    setTimeout(() => {
      $(".ku-progressBar__chart .animated-progress span").each(function () {
          var _this = $(this)
          if (_this.hasClass("animated")){
            const total = _this.attr("data-progress") * 10
            const val = (_this.attr("data-progress") * 10 / 10).toFixed(1)
            _this.css('width',total+ "%");
            _this.find('.val').text(val);
            $(this).find('.val_p').text(total+"%");
          }
      });
    },0)
  }




