function lottieTrigger() {
  if ($('.lottie-player').length > 0) {
    var win = $(window);
    var allMods = $(".lottie-player");
    var _ary = [];
    allMods.each(function (i, el) {
      var _loop = $(this).attr('data-loop');
      var _id = $(this).attr('id');
      var _url = $(this).attr('data-url');
      if(_loop == 'true'){
      var _loop_status = true;
      }else{
        var _loop_status = false;
      }

      _ary[i] = {
        container: document.getElementById(_id),
        path: _url,
        renderer: 'svg',
        autoplay: false,
        loop: _loop_status,
      };
      var anim = bodymovin.loadAnimation(_ary[i]);
      
      win.scroll(function (event) {
        var $this = $(this);
        setTimeout(function(){
          var _id = $(el).attr('id');
          var el1 = $('#' + _id);
          if (el1.length > 0) {
            if(el1.visible(true)){
              if (!el1.hasClass('done')) {
                el1.addClass('done');
                anim.playSegments(1, true);
                // if (window.innerWidth < 768 && window.innerHeight < 700 && $('.homeLC .homeLC_lottie .lottie-player').length > 1) {
                //   if ($(window).scrollTop() > 60) {
                //   }
                  
                // } else {
                //     el1.addClass('done');
                //     anim.playSegments(1, true);
                // }
                
              } 
            }
            else{
              el1.removeClass('done');
              anim.stop();
            } 
          }
      },100)
      });
    });


  } 

  
}

$(document).ready(function () {
  // Lottie Anim Init
  lottieTrigger();
})